/// result : [{"vt_objektnr_extern":"KBSW20036","isfavroite":"0","kat_vermarktungsart":"KAUF","kat_objektart":"HAUS","kat_objektart2":"DOPPELHAUSHAELFTE","pr_kaufpreis":"545000.00","geo_ort":"Teltow","fl_wohnflaeche":"136.00","fl_nutzflaeche":"220.00","fl_anzahl_zimmer":"5.00","fl_anzahl_badezimmer":"2.00","fl_anzahl_schlafzimmer":"0.00","fl_anzahl_terrassen":"1.00","pr_stp_freiplatz_anzahl":"2.00","ft_objekttitel":"Doppelhaushälfte\nzum Verlieben! Hier in Teltow!","ft_objektbeschreibung":"Verkauft wird eine Doppelhaushälfte in Teltow mit noch zu\nparzellierender Teilfläche nach notariellem Kaufabschluss, mit gemeinsamen Geh-Fahr- und Leitungsrecht. Das Haus\nDoppelhaushälfte mit teilvermietetem Anbau Teilunterklellert Bj 1926 Ca. 520qm Grundstück Zustand: Gepflegt,\neinfacher Standard Garten, Terrasse Anbau im OG vermietet, im EG Werkstattraum 2 PKW Stellplätze Bad mit Dusche und\nWanne Einbauküche Brunnen Bezugsfrei ab Dezember 2020 Energieversorgung Gas Zentralheizung mit Solarthermie Bj 2020\nund neuen Heizkörpern Objektbeschreibung Die teilunterkellerte Doppelhaushälfte wurde 1926 gebaut, hat eine\nWohnfläche von 100qm, einen Anbau bestehend aus vermieteten 27qm und 27qm Werkstattraum. Das Haus hat 4 Zimmer,\nwelche sich auf 78qm im Erdgeschoß und ca 22qm ausgebautes Dachgeschoss erstrecken. Der Keller dient als\nLagerfläche der Heizung und Hausrat. Das Haus befindet sich auf einem ca. 520qm großem, grünen\nGrundstück. Es sind zwei PKW Stellplätze vorhanden. Die Anlegung einer Zufahrt zur zweiten Parzelle erfolgt\nnach Kaufabschluss und ist in der Gesamtgrundstücksgröße enthalten. Es wird ein gemeinsames Wege/Fahr\nund Leitungsrecht ins Grundbuch eingetragen. Potential Da der Anbau und das Haupthaus an einer gemeinsamen Wand\nverbunden sind, besteht die Möglichkeit die Wohnfläche um den gesamten Anbau zu erweitern. Es wäre dann\neine Maximalwohnfläche von ca 154qm möglich. Ein Durchbruch vom Haupthaus in den Anbau wurde bereits angelegt,\nist zur Zeit aber zuge