-9fca9b1c27f0.jpg\",\"url_thumb\":\"4bd036be-49f5-49ef-b475-9fca9b1c27f0_thumb.jpg\",\"url_md\":\"4bd036be-49f5-49ef-b475-9fca9b1c27f0_md.jpg\"},{\"title\":\"Auu00dfenansicht\nvor dem\nEingang\",\"url\":\"bda68166-c357-450c-86ce-ef6a512bfb22.jpg\",\"url_thumb\":\"bda68166-c357-450c-86ce-ef6a512bfb22_thumb.jpg\",\"url_md\":\"bda68166-c357-450c-86ce-ef6a512bfb22_md.jpg\"},{\"title\":\"Vorgarten\",\"url\":\"34a75023-4175-4c3c-95ba-3d4565cb36cb.jpg\",\"url_thumb\":\"34a75023-4175-4c3c-95ba-3d4565cb36cb_thumb.jpg\",\"url_md\":\"34a75023-4175-4c3c-95ba-3d4565cb36cb_md.jpg\"},{\"title\":\"Ansicht\naus\nGarten\",\"url\":\"c10234fd-a092-415d-aaf4-8b1d2c4f399c.jpg\",\"url_thumb\":\"c10234fd-a092-415d-aaf4-8b1d2c4f399c_thumb.jpg\",\"url_md\":\"c10234fd-a092-415d-aaf4-8b1d2c4f399c_md.jpg\"},{\"title\":\"Innenaufnahme\nEsszimmer\",\"url\":\"bfe605a6-3f27-4250-8291-c754942abc95.jpg\",\"url_thumb\":\"bfe605a6-3f27-4250-8291-c754942abc95_thumb.jpg\",\"url_md\":\"bfe605a6-3f27-4250-8291-c754942abc95_md.jpg\"},{\"title\":\"Innenaufnahme\nWohnzimmer\",\"url\":\"65fd51f0-52c9-4311-9219-3df3fec352ca.jpg\",\"url_thumb\":\"65fd51f0-52c9-4311-9219-3df3fec352ca_thumb.jpg\",\"url_md\":\"65fd51f0-52c9-4311-9219-3df3fec352ca_md.jpg\"}]","folder":"openimmo/data/Kensington_KBN_107"},{"vt_objektnr_extern":"KBN1908","isfavroite":"0","kat_vermarktungsart":"KAUF","kat_objektart":"HAUS","kat_objektart2":"VILLA","pr_kaufpreis":"0.00","geo_ort":"Berlin\n/\nPankow","fl_wohnflaeche":"182.51","fl_nutzflaeche":"0.00","fl_anzahl_zimmer":"7.00","fl_anzahl_badezimmer":"1.00","fl_anzahl_schlafzimmer":"1.00","fl_anzahl_terrassen":"1.00","pr_stp_freiplatz_anzahl":"2.00","ft_objekttitel":"Villa\nin Bestlage zwischen Bügerpark und Schlosspark","ft_objektbeschreibung":"Beeindruckend und von geschichtlicher\nBedeutung ist die passende Bezeichnung für den Standort von der im Jahr 1937/38 errichteten Villa. Die\neinzigartige Lage zwischen dem zwölf Hektar großem Bürgerpark sowie dem Schlosspark mit dem Schloss\nSchönhausen aus der historischen Regierungszeit von Friedrich des Großen und der angrenzenden Panke, verleihen\ndem 605 m² großem Grundstück das Prädikat wertvoll.\nDer Charme und die Einzigartigkeit mit der\nBaukunst des vorherigen Jahrhunderts, vereint sich auf einer Wohnfläche von ca. 183 m². Insbesondere das\nGrundstück mit der exklusiven Lage sowie die Umgebungsbebauung und dem hohen Maß an Flexibilität der\nzukünftigen Nutzung, garantieren Wertbeständigkeit über Generationen.\nAuf insgesamt drei Wohnebenen plus\nKeller bietet diese familienfreundliche Immobilie viele Möglichkeiten der räumlichen Entfaltung, ebenso ist\nein generationsübergreifendes Miteinander vorstellbar. \nIm Laufe der Zeit hat sich ein Renovierungs- sowie\nErneuerungsstau gebildet, der auf Hinblick der zukünftigen Nutzung berücksichtigt werden sollte. Vom\nEingangsbereich über den Flur gelangt man in den repräsentativen Wohnbereich mit angrenzendem Wintergarten.\nEin weiteres Zimmer wird z.Zt. als Büro genutzt. Mit Blick in den Naturgarten rundet die Küche das Erdgeschoss\nab. Das gesamte Erdgeschoss verfügt, ausgenommen der Küche, über hochwertige Holz- und\nParkettfußböden. Eine massive Holztreppe führt in den Flurbereich des Obergeschosses mit weiteren drei\nRäumen. Besonders charmant ist die Bibliothek mit Kaminkassette und die großzügig geschnittene ca. 15\nm² große Dachterrasse mit dem atemberaubenden Blick auf den Gartenteich, was vollkommende Privatsphäre im\nBerliner Norden beschert.\nZwei miteinander verbundene Räume, inklusive Südbalkon, bieten sich als Schlaf- und\nAnkleidezimmer an. Das taghelle mit Marmor versehene Badezimmer komplettiert das Obergeschoss. Mit Ausnahme des\nBadezimmers wurde im gesamten Obergeschoss hochwertiges Parkett verlegt. Ein weiteres Highlight des Hauses ist\nsicherlich der ausgebaute Dachboden, welcher über eine malerische Treppe zugänglich ist. Eine Vielzahl\neingebauter Dachfenster bescheren optimale Lichtverhältnisse. Die verarbeiteten Naturhölzer vermitteln ein\nharmonisches und stilvolles Ambiente. Das komplett unterkellerte Haus bietet in der zukünftigen Nutzung\nsämtlichen Spielraum. Die mit Fenstern versehenen Kellerräume werden z.Zt. als Büro-, Hobby-, Abstell-\nund Heizungsraum genutzt. Der angelegte Garten, welcher Mensch und Natur in Einklang bringt, ist von außen nicht\neinsehbar und garantiert erholsame Stunden im Grünen. Die Königin der Teichpflanzen, die Seerose, befindet\nsich für naturverbundene Liebhaber im eigens dafür angelegten Gartenteich. \nCharmante Details des Hauses wie\nHolz- und Parkettböden, zum Teil verbaute Doppelkastenfenster sowie mit Bleikristallelementen versehene Fenster\nblieben der Villa erhalten und geben ihr den Mantel eines luxuriösen Anwesens.\n\nWir freuen uns auf Ihre\nKontaktaufnahme und würden Ihnen gerne diese charmante Villa bei einer Besichtigung\nvorstellen.","imglist":"[{\"title\":\"Hausansicht\",\"url\":\"3d9d3fb2-c654-485e-82e0-4c939191c271.jpg\",\"url_thumb\":\"3d9d3fb2-c654-485e-82e0-4c939191c271_thumb.jpg\",\"url_md\":\"3d9d3fb2-c654-485e-82e0-4c939191c271_md.jpg\"},{\"title\":\"Hausansicht\",\"url\":\"97924fc7-7cd3-4d0c-aff1-e750644e1aa5.jpg\",\"url_thumb\":\"97924fc7-7cd3-4d0c-aff1-e750644e1aa5_thumb.jpg\",\"url_md\":\"97924fc7-7cd3-4d0c-aff1-e750644e1aa5_md.jpg\"}]","folder":"openimmo/data/KBN1908"},{"vt_objektnr_extern":"KBN1908","isfavroite":"0","kat_vermarktungsart":"KAUF","kat_objektart":"HAUS","kat_objektart2":"VILLA","pr_kaufpreis":"0.00","geo_ort":"Berlin\n/\nPankow","fl_wohnflaeche":"182.51","fl_nutzflaeche":"0.00","fl_anzahl_zimmer":"7.00","fl_anzahl_badezimmer":"1.00","fl_anzahl_schlafzimmer":"1.00","fl_anzahl_terrassen":"1.00","pr_stp_freiplatz_anzahl":"2.00","ft_objekttitel":"","ft_objektbeschreibung":"","imglist":"[{\"title\":\"Hausansicht\",\"url\":\"3d9d3fb2-c654-485e-82e0-4c939191c271.jpg\",\"url_thumb\":\"3d9d3fb2-c654-485e-82e0-4c939191c271_thumb.jpg\",\"url_md\":\"3d9d3fb2-c654-485e-82e0-4c939191c271_md.jpg\"},{\"title\":\"Hausansicht\",\"u