.00","fl_anzahl_badezimmer":"1.00","fl_anzahl_schlafzimmer":"1.00","fl_anzahl_terrassen":"1.00","pr_stp_freiplatz_anzahl":null,"ft_objekttitel":"Stilvolles\nWohnen mit Blick auf Schloss Königs Wusterhausen mit Südbalkon, Tiefgarage und\nAufzug!","ft_objektbeschreibung":"Die Schlossblick-Terrassen Residenz am Fuße des Funkerbergs im Zentrum von\nKönigs Wusterhausen fügt sich mit den Rundungen am Baukörper harmonisch in die Landschaft ein. Neben\neiner Tiefgarage für alle Fahrzeuge und einem Personenaufzug entstehen 17 exklusive Mietwohnungen. Große\nFenster, geräumige Balkone und moderne Bäder sowie Dachterrassen entsprechen den zeitgemäßen\nAnsprüchen für gehobenes Wohnen. Die Fertigstellung ist für Sommer 2021 geplant.\n\nWeitere Wohnungen\nfinden Sie auf der Internetseite: https://www.schlossblick-terrassen.de/","imglist":"[{\"title\":\"Ansicht\nFront1\",\"url\":\"59fc8d5a-50ba-44c1-8698-c7ca10426562.jpg\",\"url_thumb\":\"59fc8d5a-50ba-44c1-8698-c7ca10426562_thumb.jpg\",\"url_md\":\"59fc8d5a-50ba-44c1-8698-c7ca10426562_md.jpg\"},{\"title\":\"Schulweg-Ansicht1\",\"url\":\"60c2dcf3-0e7f-4c8c-8f60-8589af25aa11.jpg\",\"url_thumb\":\"60c2dcf3-0e7f-4c8c-8f60-8589af25aa11_thumb.jpg\",\"url_md\":\"60c2dcf3-0e7f-4c8c-8f60-8589af25aa11_md.jpg\"},{\"title\":\"Ansicht\nSu00fcd\",\"url\":\"f75ace79-dd49-435b-a0fa-e919790554db.jpg\",\"url_thumb\":\"f75ace79-dd49-435b-a0fa-e919790554db_thumb.jpg\",\"url_md\":\"f75ace79-dd49-435b-a0fa-e919790554db_md.jpg\"},{\"title\":\"Bad-Muster\",\"url\":\"4af35ce0-b003-4451-bab5-fa8db3f6b17f.jpg\",\"url_thumb\":\"4af35ce0-b003-4451-bab5-fa8db3f6b17f_thumb.jpg\",\"url_md\":\"4af35ce0-b003-4451-bab5-fa8db3f6b17f_md.jpg\"},{\"title\":\"Grundriss\nWe\n7\",\"url\":\"89261948-7e3a-48f7-83ff-470a62696a14.jpg\",\"url_thumb\":\"89261948-7e3a-48f7-83ff-470a62696a14_thumb.jpg\",\"url_md\":\"89261948-7e3a-48f7-83ff-470a62696a14_md.jpg\"}]","folder":"openimmo/data/Kensington_KBSOW201B"},{"vt_objektnr_extern":"Kensington_KBSOW206","isfavroite":"0","kat_vermarktungsart":"MIETE_PACHT","kat_objektart":"WOHNUNG","kat_objektart2":"ERDGESCHOSS","pr_kaufpreis":null,"geo_ort":"Königs\nWusterhausen","fl_wohnflaeche":"70.00","fl_nutzflaeche":"5.00","fl_anzahl_zimmer":"3.00","fl_anzahl_badezimmer":"1.00","fl_anzahl_schlafzimmer":"2.00","fl_anzahl_terrassen":"1.00","pr_stp_freiplatz_anzahl":null,"ft_objekttitel":"Zernsdorf:\nErstbezug 3 Zimmer inkl. moderner Einbauküche und KFZ Stellplatz Nähe\nWasser!","ft_objektbeschreibung":"Erstbezug in moderner Stadtvilla. Fertigstellung Anfang 2021.Alle Wohnungen haben 3\nZimmer inkl. modernen Einbauküchen. Die Wohnfläche der Wohnungen im Erdgeschoss beträgt ca. 70 m²\nzzgl. anteiliger Gärten sowie jeweils 1 KFZ Aussenabstellplatz. Die Wohnungen im Obergeschoss haben ebenso ca. 70\nm² zzgl. einem eigenen Zugang zum Dach. Dieses ist nutzbar als zusätzlicher Abstellplatz.\n\nDie Wohnungen im\nErdgeschoss sind barrierefrei zu erreichen.\n\nDie Beheizung erfolgt über eine umweltfreundliche\nFernwärmeanbindung. Alle Etagen sind mit einer Fußbodenbodenheizung ausgestattet. Die großen Fenster mit\nDreifachverglasung erzeugen ein unvergleichliches Gefühl von Licht und Großzügigkeit. Die hochwertige\nAusstattung wird durch bekannte Hersteller unterstrichen. Das Mehrfamilienhaus liegt an einer Straße ohne\nDurchgangsverkehr. Somit können Ihre Mieter oder Eigentümer dem hektischen Treiben der pulsierenden Hauptstadt\nentfliehen.\n\nDer Zernsdorfer Krüpelsee und die Marina sind ca. 150 Meter entfernt.","imglist":"[{\"title\":\"Foto\nHaus\",\"url\":\"_578717.jpg\",\"url_thumb\":\"_578717_thumb.jpg\",\"url_md\":\"_578717_md.jpg\"},{\"title\":\"Grundriss-EG\",\"url\":\"_578733.jpg\",\"url_thumb\":\"_578733_thumb.jpg\",\"url_md\":\"_578733_md.jpg\"}]","folder":"openimmo/data/Kensington_KBSOW206"},{"vt_objektnr_extern":"Kensington_KBSOW206","isfavroite":"0","kat_vermarktungsart":"MIETE_PACHT","kat_objektart":"WOHNUNG","kat_objektart2":"ERDGESCHOSS","pr_kaufpreis":null,"geo_ort":"Königs\nWusterhausen","fl_w